import React from "react";
import "./App.css";
import Navbar from "./components/Navbar";
import Cards from "./components/Cards";
import Footer from "./components/Footer";
import { Link } from "react-router-dom";

class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      inputValue: "",
      cards: [
        {
          img:
            "https://pbs.twimg.com/profile_images/1259719811296309249/um6CLRiM_400x400.jpg",
          title: "CourseIt",
          description: "Descripci贸n de CourseIt",
        },
        {
          img:
            "https://pbs.twimg.com/profile_images/1052208764726730753/s5bagDr__400x400.jpg",
          title: "Endava",
          description: "Descripci贸n de Endava",
        },
      ],
    };
  }

  handleData(inputValue) {
    this.setState({ inputValue: inputValue });
  }

  componentDidMount() {
    this.setState({  });
  }

  render() {
    const { inputValue, cards } = this.state;
    return (
      <div className="App">
        <Navbar
          getData={(inputValue) => this.handleData(inputValue)}
          name="STARTUP ARGENTINA"
          search={true}
        />
        <Cards filter={inputValue} cards={cards} />
        <Footer creator="Gonzalito" />
        <Link to={{ pathname: "/prueba", cards: cards }}>Ir a Prueba</Link>
      </div>
    );
  }
}

export default App;
